import React, { Component } from "react";
import { observer } from "mobx-react";

const Pong = observer(
  class Pong extends Component {
    render() {
      return (
        <div>
          <h1>{this.props.store.data}</h1>
          <h1>{this.props.store.compdata}</h1>
          <div className="game">
            <div className="bars" />
            <div className="bars" />
            <span className="ball" />
          </div>
        </div>
      );
    }
  }
);

export default Pong;
